import styled from "styled-components";

export const FooterStyled = styled.footer`
  width: 50%;
  border-top: solid 0.01px #6E7781;
  color: #6E7781;
  display: flex;
  justify-content: center;
  align-items: center;
  height: 100px;
  margin: auto;
  @media screen and (max-width: 900px) {
      width:85%;
  }

`
